import React, { useEffect, useState } from 'react';

function AdminVolunteer() {
  const [eventNames, setEventNames] = useState([]);

  useEffect(() => {
    fetch('http://localhost:5000/api/volunteers/events')
      .then((response) => {
        if (!response.ok) {
          throw new Error('Network response was not ok');
        }
        return response.json();
      })
      .then((data) => {
        console.log('Fetched event names:', data); // Debugging: check the structure of the data
        console.log(eventNames[0].name);
        setEventNames(data);
      })
      .catch((error) => console.error('Error fetching event names:', error));
  }, []);

  return (
    <div>
      <h1>Admin Page</h1>
      <p>This is the admin volunteer management page.</p>
      <ul>
      {eventNames.length > 0 ? (
          <p>First Event: {eventNames[0].name}</p>
        ) : (
          <p>No events found</p>
        )}
      </ul>
    </div>
  );
}

export default AdminVolunteer;
